INSERT INTO `sys_work_record` VALUES ('927', '2019-07-11 09:07:25', '5', 'zhengbin', null, null, null, '1', '通过对这四个网站的分析、学习，对专利运营稍微有了一些浅显的了解。通常，平台主要扮演中介的身份，将各个渠道获取到的专利，通过一系列的介绍、说明、包装，吸引有交易需求的对象，主要是买专利的。与此配套的，平台还开展一系列的知识产权服务、法律服务。纵观，平台纯粹就是一个知识产权中介服务机构。', '2', '2019-07-10', '5', '112', '22', '2019-07-11 09:07:25', '郑斌', '2019-07-11 09:08:22', '5', 'zhengbin');
